import React from 'react';
import logo4 from './images/logo4.png';
const Header = ()=>{
    return (
        <>
        <div className="header">
            <img src={logo4} alt="logo" width="50" height="55" />
            <h2>  Keep</h2>
        </div>
        </>
    );
}

export default Header;
